// Controlador TPS Completo
// Requisitos na UI:
// 1. Joystick (tag: "joystick")
// 2. Slide Area/Touchpad (tag: "touchpad")
// 3. Boto de Pulo (tag: "btn_jump")
// 4. Boto de Correr (tag: "btn_run")
//
// Configurao do Modelo:
// - Fsica: Dinmico, Travar Rotao: ATIVADO
// - Animaes: "Idle", "Walk", "Run", "Jump_Start", "Jump_Loop", "Jump_End"

function start() {
    // --- Configuraes de Movimento ---
    this.walkSpeed = 5.0;
    this.runSpeed = 12.0; 
    this.rotateSpeed = 15.0;
    this.jumpForce = 8.0; 

    // Inverter Eixos do Joystick
    this.invertX = true; 
    this.invertY = true;

    // --- Cmera ---
    // Busca a cmera principal da cena
    this.camera = scene.getObjectByProperty("isCamera", true);
    this.camDist = 3.5;   
    this.camHeight = 1.8; 
    this.yaw = Math.PI; 
    this.pitch = 0.2;
    this.sensitivity = 0.005; 

    // --- Animaes (Edite os nomes aqui) ---
    this.animIdle = "Idle_Loop";
    this.animWalk = "Walk_Loop";
    this.animRun = "Sprint_Loop";
    this.animJumpStart = "Jump_Start"; // Inicio do pulo
    this.animJumpLoop = "Jump_Loop";   // Caindo
    this.animJumpEnd = "Jump_Land";     // Aterrisando

    // Estado Interno
    this.isGrounded = false;
    this.wasGrounded = false;
    this.jumpPressed = false;
    this.landTimer = 0; // Tempo travado na animao de pouso

    // Inicia parado
    if(this.animation) this.animation.play(this.animIdle, 0.2);
}

function update(dt) {
    if (!object.physics) return;

    // --- 1. CMERA (Touchpad) ---
    const touch = Input.getTouchpad("touchpad");
    if (touch.deltaX !== 0 || touch.deltaY !== 0) {
        this.yaw -= touch.deltaX * this.sensitivity;
        this.pitch += touch.deltaY * this.sensitivity;
    }
    // Limita o ngulo vertical
    this.pitch = Math.max(-0.5, Math.min(1.2, this.pitch));

    // Posiciona Cmera
    if (this.camera) {
        const target = object.position.clone().add(new THREE.Vector3(0, this.camHeight, 0));
        const hDist = this.camDist * Math.cos(this.pitch);
        const camX = target.x + hDist * Math.sin(this.yaw);
        const camZ = target.z + hDist * Math.cos(this.yaw);
        const camY = target.y + this.camDist * Math.sin(this.pitch);
        this.camera.position.set(camX, camY, camZ);
        this.camera.lookAt(target);
    }

    // --- 2. CHECAGEM DE CHO (Apenas para animao) ---
    const vel = object.physics.getVelocity();
    // Verifica se a velocidade vertical  quase zero
    this.isGrounded = Math.abs(vel.y) < 0.1;

    // Lgica de Aterrisagem
    if (this.isGrounded && !this.wasGrounded) {
        // Toca animao de pouso
        if(this.animation) this.animation.play(this.animJumpEnd, 0.1);
        this.landTimer = 0.4; // Fica um tempo na animao
    }
    this.wasGrounded = this.isGrounded;

    if (this.landTimer > 0) this.landTimer -= dt;

    // --- 3. INPUT MOVIMENTO ---
    const joy = Input.getJoystick("joystick");
    const inputX = joy.x * (this.invertX ? -1 : 1);
    const inputY = joy.y * (this.invertY ? -1 : 1);
    const direction = new THREE.Vector3(inputX, 0, inputY); 
    const isMoving = direction.length() > 0.1;
    const isRunning = Input.isButtonPressed("run");
    const currentSpeed = isRunning ? this.runSpeed : this.walkSpeed;

    // --- 4. INPUT PULO (LIVRE) ---
    // Permite pulo no ar, mas exige soltar o boto para pular de novo
    const btnJump = Input.isButtonPressed("jump");

    if (btnJump && !this.jumpPressed) {
        // Aplica fora para cima
        // Zera velocidade Y para pulo consistente no ar
        object.physics.setVelocity(vel.x, 0, vel.z);
        object.physics.applyImpulse(0, this.jumpForce, 0);

        if(this.animation) this.animation.play(this.animJumpStart, 0.1);

        this.isGrounded = false; // Sai do cho imediatamente
        this.landTimer = 0;      // Cancela pouso
    }
    this.jumpPressed = btnJump; // Trava o boto at soltar

    // --- 5. APLICAO DE MOVIMENTO E ANIMAO ---

    // Animao de queda (Loop)
    if (!this.isGrounded && vel.y < -0.5) {
        if(this.animation) this.animation.play(this.animJumpLoop, 0.2);
    }

    if (isMoving) {
        // Se mover, cancela animao de pouso
        this.landTimer = 0; 

        // Calcula direo relativa  cmera
        direction.applyAxisAngle(new THREE.Vector3(0,1,0), this.yaw + Math.PI);
        direction.normalize();

        // Move o personagem
        object.physics.setVelocity(direction.x * currentSpeed, object.physics.getVelocity().y, direction.z * currentSpeed);

        // Gira o personagem suavemente
        const targetAngle = Math.atan2(direction.x, direction.z);
        const targetQuat = new THREE.Quaternion().setFromAxisAngle(new THREE.Vector3(0,1,0), targetAngle);
        object.quaternion.slerp(targetQuat, this.rotateSpeed * dt);

        // Animao de andar/correr (se estiver no cho)
        if (this.isGrounded) {
            const animName = isRunning ? this.animRun : this.animWalk;
            if(this.animation) this.animation.play(animName, 0.2);
        }
    } else {
        // Parar movimento horizontal
        object.physics.setVelocity(0, object.physics.getVelocity().y, 0);

        // Animao parado (se estiver no cho e no estiver pousando)
        if (this.isGrounded && this.landTimer <= 0) {
            if(this.animation) this.animation.play(this.animIdle, 0.2);
        }
    }
}
